<style>
  body {
    font-family: sans-serif;
  }
  div#log {
    position:absolute;
    top: 500px;
    left: 400px;
    font-weight: bold;
  }
</style>

<div id="log"></div>

<script src="web-animations.js"></script>
<script>
"use strict";

function pathForCountry(code) {
  return document.getElementById(code).getAttribute('d');
}

var svgRoot = document.getElementsByTagName('svg')[0];
var countryCodes = [];
var total = svgRoot.children.length;
for (var i = 0; i < total; i++) {
  if (svgRoot.children[i].id != 'test')
    countryCodes.push(svgRoot.children[i].id);
}
countryCodes.sort();

var path = document.getElementById('test');
var log = document.getElementById('log');
var baseDuration = 2;

var children = countryCodes.map(function(x) {
  return new ParGroup([
    new Animation(path, [{d: pathForCountry(x)}], baseDuration),
    // FIXME: Using an event for this crashes Chrome!
    new Animation(
        null,
        {sample: function() { log.textContent = x; }},
        {fill: 'none', duration: 0.1}),
    new Animation(
        log,
        [{opacity: 0}, {opacity: 1}],
        {fill: 'none', duration: baseDuration})
  ], {easing: 'ease'});
});

document.timeline.play(new SeqGroup(children, {iterations: Infinity}));

</script>
